<script>
import Web3 from "web3";
import ABI from "./../contracts/EcioAirDrop.json";
export default {
  data() {
    return {
      isSuccess: false,
      contracts: {
        airdropNFT: "0x0BDF643161E49f51158fd3bB43B0AbB2176B6B74"
      },
      form: {
        walletAddress: "",
        email: "",
        twitter: "",
        telegram: ""
      },
      error: {
        hasMetaMask: true,
        isReceived: false,
        isMaticNetwork: true
      },
      airdropNFTContract: undefined,
      transactionHash: ""
    };
  },
  mounted() {
    var that = this;
    if (this.isHaveMetaMask() && this.isMetaMask()) {
      //รอฟังการเปลี่ยน account
      window.ethereum.on("accountsChanged", function(accounts) {
        console.log("accountsChanged");
        if (accounts.length == 0) {
          that.clear();
          this.error.isMaticNetwork = true;
        } else {
          that.form.walletAddress = accounts[0];
          that.loadContract();
        }
      });

      window.ethereum.on("chainChanged", _chainId => {
        console.log("chainChanged");
        console.log(_chainId);
        this.loadContract();
      });

      ///this.loadContract();
    }
  },
  methods: {
    async loadContract() {
      var that = this;

      //เชื่อม mataMask กับ Web3
      window.web3 = new Web3(window.ethereum);

      await window.ethereum
        .request({ method: "eth_chainId" })
        .then(_chainId => {
          this.error.isMaticNetwork = that.validateChain(_chainId);
        });

      if (this.error.isMaticNetwork) {
        this.form.walletAddress = window.ethereum.selectedAddress;

        //สร้าง Instance ของ Contract ด้วย ABI และ address ของ contract ที่ Deploy ไปแล้ว
        this.airdropNFTContract = new window.web3.eth.Contract(
          ABI.abi,
          this.contracts.airdropNFT
        );

        this.setupEvent();
        this.BalanceOfNFTs(this.form.walletAddress);
      } else {
        this.clear();
      }
    },
    clear() {
      this.form.walletAddress = "";
      this.error.isMaticNetwork = false;
      this.error.isReceived = false;
    },
    setupEvent() {
      this.airdropNFTContract.events
        .getNFTAirdropEvent(
          {
            filter: {
              //to: this.form.walletAddress ,
              //transactionHash: this.transactionHash
              // myOtherIndexedParam: "0x123456789...",
            } // Using an array means OR: e.g. 20 or 23
            // fromBlock: 0,
          },
          function(error, event) {
            console.log(event);
          }
        )
        .on("connected", function(subscriptionId) {
          console.log(subscriptionId);
        })
        .on("data", function(event) {
          console.log(event);
        })
        .on("changed", function(event) {
          console.log(event);

          // remove event from local database
        })
        .on("error", function() {
          // If the transaction was rejected by the network with a receipt, the second parameter will be the receipt.
        });
    },

    validateChain(_chainId) {
      console.log(_chainId);
      // return _chainId == "0x13881" || _chainId == "0x89"; //Polygon
      return _chainId == "0x386" || _chainId == "56" || _chainId == "0x38"; //BSC
    },

    async connectWallet() {
      //ตรวจว่ามี MetaMask หรือไม่
      if (this.isHaveMetaMask() && this.isMetaMask()) {
        //เปิดการเชื่อมต่อกับ MetaMask
        await window.ethereum.request({ method: "eth_requestAccounts" });

        this.loadContract();
      } else {
        this.error.hasMetaMask = false;
      }
    },
    //ตรวจสอบว่ามี Wallet หรือไม่
    isHaveMetaMask() {
      return typeof window.ethereum !== "undefined";
    },

    //ตรวจสอบว่า Wallet ที่มีเป็น MetaMask ไหม
    isMetaMask() {
      return window.ethereum.isMetaMask;
    },

    BalanceOfNFTs(address) {
      var that = this;
      this.airdropNFTContract.methods
        .balanceOf(address, 0)
        .call()
        .then(results => {
          console.log(results);

          that.error.isReceived = parseInt(results) > 0;
        });
    },

    async ReceiveAirDrop() {
      var ref = localStorage.getItem("ref");
      if (ref == undefined || ref == "") {
        ref = "0x0000000000000000000000000000000000000000";
      }
      var that = this;
      await this.airdropNFTContract.methods
        .getNFTAirdrop(0, ref)
        .estimateGas({ from: this.form.walletAddress })
        .then(function(gasAmount) {
          console.log(gasAmount);
        })
        .catch(function(error) {
          console.log(error);
        });
      //  var that = this;
      await this.airdropNFTContract.methods
        .getNFTAirdrop(0, ref)
        .send({ from: this.form.walletAddress })
        .on("receipt", function(data) {
          console.log("receipt");
          console.log(data);
          that.isSuccess = true;
          that.$router.push({
            path: "airdrop-success",
            query: { tid: that.transactionHash }
          });
        })
        .on("sent", function(data) {
          console.log(data);
        })
        .on("transactionHash", function(data) {
          console.log(data);
          that.transactionHash = data;
        })
        .on("confirmation", function(data) {
          //console.log("confirmation");
          console.log(data);
        })
        .on("error", function(data) {
          console.log(data);
        });
    }
  }
};
</script>
